                if i + 2 >= len(s) or s[i + 2] == ')':
                    s = s[:i + 1] + ['*', s[i + 1]] + s[i + 2:]
                else:
                    s = s[:i + 1] + ['*', s[i + 1], '+'] + s[i + 2:]
                i += 1
            elif s[i + 1].isalpha() or s[i + 1] == '(':
                s = s[:i + 1] + ['+'] + s[i + 1:]
        i += 1
    s = ''.join(s)
    s = s.strip('+')
    x = 2
    y = 4
    z = 10
    total_weight = eval(s)
    return total_weight

